package net.xuite.blog.ray00000test.library.comicsdk;

import java.util.ArrayList;
import java.util.List;

/**
 * nview.js
 * 
 * 解析每集(話)漫畫圖片下載網址
 * 
 * @author Ray Lee Created on 2017/08/17
 */
public class JSnview {
	private String mSource;
	private int mCh;
	private int mChs = 0;
	private int mTi = 0;
	private int mPs = 0; // 漫畫總頁數
	private String mCs = "";
	private String mC = "";
	private static final int F = 50;
	private static final int Y = 46;
	private static final String AZ = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ";

	public void setSource(String source){
		mSource = source;
	}
	
	/*
	 * 取得集數編號，例如1、2、3…
	 */
	public int getCh() {
		return mCh;
	}

	public void setCh(int ch) {
		mCh = ch;
	}

	/*
	 * 取得最新集數，例如最新第68號，此回傳值則為68
	 */
	public int getChs() {
		return mChs;
	}

	public void setChs(int chs) {
		mChs = chs;
	}

	public int getTi() {
		return mTi;
	}

	public void setTi(int ti) {
		mTi = ti;
	}

	public int getPages() {
		return mPs;
	}

	/*
	 * 取得單集漫畫混淆過的編碼
	 */
	public String getCs() {
		return mCs;
	}

	public void setCs(String cs) {
		mCs = cs;
	}

	public String getC() {
		return mC;
	}
	
	/**
	 * 解析漫畫圖片下載網址
	 * @return
	 */
	public List<String> setupPagesDownloadUrl() {
		System.out.println("mSource==>" + mSource);
		List<String> urlList = new ArrayList<String>();
		for (int i = 0; i < 472; i++) {
			String dmikv = lc(su(mCs, i * Y + 0, 40));
			String wnjay = lc(su(mCs, i * Y + 40, 2));
			String wqlbl = lc(su(mCs, i * Y + 42, 2));
			String kcwsi = lc(su(mCs, i * Y + 44, 2));
			mPs = Integer.parseInt(wnjay);
			
			if (Integer.parseInt(kcwsi) == mCh) {
				for(int p = 1; p <= mPs; p++){
				
					String result1 = su(wqlbl, 0, 1);
					String result2 = su(wqlbl, 1, 1);
					String result3 = su(dmikv, mm(p), 3);
					
					String src = "http://img" + result1 + ".8comic.com/" + result2 + '/' + mTi + '/' + kcwsi
							+ '/' + nn(p) + '_' + result3 + ".jpg";
					
					urlList.add(src);
				}
				break;
			}
		}
		
		return urlList;
	}

	private String lc(String l) {
		if (l.length() != 2) {
			return l;
		}
		
		String a = l.substring(0, 1);
		String b = l.substring(1, 2);
		if (a == "Z") {
			return String.valueOf(8000 + AZ.indexOf(b));
		} else {
			return String.valueOf(AZ.indexOf(a) * 52 + AZ.indexOf(b));
		}
	}

	private String su(String a, int b, int c) {
		return a.substring(b, b + c);
	}

	/**
	 * @deprecated
	 */
	private void sp() {
		int cc = mCs.length();
		for (int i = 0; i < cc / F; i++) {
			if (ss(mCs, i * F, 4).equals(String.valueOf(mCh))) {
				mC = ss(mCs, i * F, F, F);
				break;
			}
		}
		if (mC.isEmpty()) {
			mC = ss(mCs, cc - F, F);
			mCh = mChs;
		}
		String ps = ss(mC, 7, 3);// 總頁數
		if (!ps.isEmpty()) {
			mPs = Integer.parseInt(ps);
		}
	}

	/**
	 * 取得卷數或集數
	 * 
	 * @deprecated
	 * @param a
	 * @param b
	 * @param c
	 * @param d
	 * @return
	 */
	private String ss(String a, int b, int c) {
		return ss(a, b, c, null);
	}

	/**
	 * 取得卷數或集數
	 * 
	 * @deprecated
	 * @param a
	 * @param b
	 * @param c
	 * @param d
	 * @return
	 */
	private String ss(String a, int b, int c, Integer d) {
		String e = a.substring(b, b + c);
		return d == null ? e.replaceAll("[a-zA-Z]", "") : e;
	}

	public String si(int p) {
		return "http://img" + ss(mC, 4, 2) + ".8comic.com/" + ss(mC, 6, 1) + "/" + mTi + "/" + ss(mC, 0, 4) + "/"
				+ nn(p) + "_" + ss(mC, mm(p) + 10, 3, F) + ".jpg";
	}

	private String nn(int n) {
		return String.valueOf(n < 10 ? "00" + n : n < 100 ? "0" + n : n);
	}

	private int mm(int p) {
		return (((p - 1) / 10) % 10) + (((p - 1) % 10) * 3);
	}
	
	public static void main(String [] args){
		JSnview nview = new JSnview();
		
		nview.setCh(1);
		nview.setTi(103);
		nview.setChs(874);
		nview.setCs("");
	
		List<String> list = nview.setupPagesDownloadUrl();
		
		System.out.println(list);
	}
}
